import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';

const useStyles = makeStyles((theme) => ({
	root: {
		'& > *': {
			margin: theme.spacing(1),
			width: '25ch'
		}
	}
}));

function ValidarCriterios() {
	const classes = useStyles();

	return (
		<form className={classes.root} noValidate autoComplete="off">
			<TextField type="number" maxLength="2"  id="filled-basic1" label="C1" variant="filled" />
			<TextField id="filled-basic2" label="C2" variant="filled" onInput = {(e) =>{
        e.target.value = Math.max(0, parseInt(e.target.value) ).toString().slice(0,2)
    }}  min={0}/>
			<TextField id="filled-basic3" label="C3" variant="filled" />
			<TextField id="filled-basic4" label="C4" variant="filled" />
		</form>
	);
}

export default React.memo(ValidarCriterios);
